# Flutterwave Payment Processing
@app.route('/payment/flutterwave/process')
def flutterwave_process():
    plan = request.args.get('plan', 'essential')
    amount = float(request.args.get('amount', '199'))
    
    # Generate unique transaction reference
    tx_ref = f"astrafabric_{plan}_{str(uuid.uuid4())[:8]}"
    
    return render_template_string(COMMON_STYLES + '''
    <!DOCTYPE html>
    <html>
    <head>
        <title>Flutterwave Payment - AstraFabric</title>
        <meta name="viewport" content="width=device-width, initial-scale=1.0">
        <script src="https://checkout.flutterwave.com/v3.js"></script>
    </head>
    <body>
        <div class="container" style="max-width: 600px; margin-top: 100px;">
            <div style="background: linear-gradient(145deg, rgba(26, 32, 44, 0.9), rgba(45, 55, 72, 0.8)); padding: 60px; border-radius: 25px; border: 2px solid rgba(66, 153, 225, 0.3); text-align: center;">
                
                <img src="''' + ASTRAFABRIC_LOGO + '''" alt="AstraFabric Logo" style="height: 60px; margin-bottom: 30px;">
                
                <h2 style="color: #4299e1;"> Flutterwave Payment</h2>
                <p style="font-size: 1.3em; margin: 20px 0;">Plan: <strong>{{ plan.title() }}</strong></p>
                <p style="font-size: 1.5em; color: #38a169; margin: 20px 0;">Amount: <strong>${{ amount }}</strong></p>
                
                <div id="payment-status" style="margin: 30px 0;">
                    <div class="loading" style="margin: 20px auto;"></div>
                    <p>Initializing secure payment...</p>
                </div>
                
                <button id="pay-button" class="btn" style="font-size: 1.2em; padding: 20px 40px; display: none;" onclick="makePayment()">
                     Pay Now with Flutterwave
                </button>
                
                <div style="margin-top: 40px;">
                    <a href="/payment/select?plan={{ plan }}&amount={{ amount }}" style="color: #63b3ed; text-decoration: none;"> Choose Different Payment Method</a>
                </div>
            </div>
        </div>
        
        <script>
            // Check if Flutterwave keys are configured
            const publicKey = '{{ flutterwave_public_key }}';
            
            function checkPaymentSetup() {
                if (!publicKey || publicKey.includes('your-key-here') || publicKey.includes('TEST')) {
                    document.getElementById('payment-status').innerHTML = `
                        <div class="error-message">
                            <h3> Payment Gateway Configuration Required</h3>
                            <p>Flutterwave API keys need to be configured by the administrator.</p>
                            <p>Please contact support for assistance.</p>
                        </div>
                    `;
                    return false;
                }
                
                document.getElementById('payment-status').innerHTML = `
                    <div class="success-message">
                        <p> Payment gateway ready!</p>
                    </div>
                `;
                document.getElementById('pay-button').style.display = 'inline-block';
                return true;
            }
            
            function makePayment() {
                if (!checkPaymentSetup()) return;
                
                FlutterwaveCheckout({
                    public_key: publicKey,
                    tx_ref: "{{ tx_ref }}",
                    amount: {{ amount }},
                    currency: "USD",
                    payment_options: "card,mobilemoney,ussd,banktransfer",
                    customer: {
                        email: prompt("Enter your email address:") || "customer@example.com",
                        phone_number: "{{ whatsapp_number }}",
                        name: prompt("Enter your full name:") || "Customer",
                    },
                    customizations: {
                        title: "AstraFabric Enterprise Security",
                        description: "{{ plan.title() }} Plan Subscription",
                        logo: "{{ astrafabric_logo }}",
                    },
                    callback: function (data) {
                        console.log(data);
                        if (data.status === 'successful') {
                            // Redirect to success page
                            window.location.href = '/payment/success?tx_ref=' + data.tx_ref + '&transaction_id=' + data.transaction_id;
                        } else {
                            alert('Payment was not successful. Please try again.');
                        }
                    },
                    onclose: function() {
                        // Payment modal closed
                        console.log('Payment modal closed');
                    }
                });
            }
            
            // Initialize payment setup check
            setTimeout(checkPaymentSetup, 2000);
        </script>
    </body>
    </html>
    ''', plan=plan, amount=amount, tx_ref=tx_ref, 
        flutterwave_public_key=FLUTTERWAVE_PUBLIC_KEY,
        whatsapp_number=WHATSAPP_NUMBER,
        astrafabric_logo=ASTRAFABRIC_LOGO)

